"use strict";(self.webpackChunkmylog=self.webpackChunkmylog||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"Vuejs basic","metadata":{"permalink":"/blog/Vuejs basic","editUrl":"https://github.com/mooyeon-choi/mooyeon-choi.github.io/tree/master/blog/2022-10-28-0119.md","source":"@site/blog/2022-10-28-0119.md","title":"Vue.js Basic","description":"\ubaa9\ucc28","date":"2022-10-28T00:00:00.000Z","formattedDate":"2022\ub144 10\uc6d4 28\uc77c","tags":[{"label":"Vuejs","permalink":"/blog/tags/vuejs"},{"label":"frontend","permalink":"/blog/tags/frontend"}],"readingTime":12.085,"hasTruncateMarker":true,"authors":[{"name":"Mooyeon Choi","url":"https://github.com/mooyeon-choi","imageURL":"https://github.com/mooyeon-choi.png","key":"mylog"}],"frontMatter":{"slug":"Vuejs basic","title":"Vue.js Basic","authors":"mylog","tags":["Vuejs","frontend"]},"nextItem":{"title":"Vue.js \uc2dc\uc791\ud558\uae30","permalink":"/blog/how to start vue.js"}},"content":"## \ubaa9\ucc28\\n\\n* [Template \ud504\ub85c\uc81d\ud2b8 \ub9cc\ub4e4\uae30](#template-\ud504\ub85c\uc81d\ud2b8-\ub9cc\ub4e4\uae30) \\n* [\uac04\ub2e8\ud55c \ud504\ub85c\uc81d\ud2b8\ub85c \ubc30\uc6b0\uae30](#\uac04\ub2e8\ud55c-\ud504\ub85c\uc81d\ud2b8\ub85c-\ubc30\uc6b0\uae30)\\n  * [Template \ubcf5\uc0ac\ud558\uae30](#template-\ubcf5\uc0ac\ud558\uae30)\\n  * [Vue Mount](#vue-mount)\\n  * [Vue \uc815\ub9ac](#vue-\uc815\ub9ac)\\n  * [Habit tracker](#habit-tracker)\\n    * [habit component \ub9cc\ub4e4\uae30](#habit-component-\ub9cc\ub4e4\uae30)\\n    * [Fontawesome \ucd94\uac00](#fontawesome-\ucd94\uac00)\\n    * [Data \uc774\ud574\ud558\uae30](#data-\uc774\ud574\ud558\uae30)\\n    * [Directives](#directives)\\n    * [Props\uc640 Emit](#props\uc640-emit)\\n\\n\x3c!--truncate--\x3e\\n\\n## Template \ud504\ub85c\uc81d\ud2b8 \ub9cc\ub4e4\uae30\\n\\n### Project \uc0dd\uc131\\n\\n```bash\\nvue create template\\n```\\n\\n* Directory Tree \ud615\ud0dc\\n\\n  ```\\n  template/\\n  \u251c\u2500\u2500 babel.config.js\\n  \u251c\u2500\u2500 node_modules/\\n  \u251c\u2500\u2500 package-lock.json\\n  \u251c\u2500\u2500 package.json\\n  \u251c\u2500\u2500 public/\\n  |  \u251c\u2500\u2500 favicon.ico\\n  |  \u2514\u2500\u2500 index.html\\n  \u251c\u2500\u2500 README.md\\n  \u2514\u2500\u2500 src/\\n     \u251c\u2500\u2500 App.vue\\n     \u251c\u2500\u2500 assets/\\n     \u251c\u2500\u2500 components/\\n     \u2514\u2500\u2500 main.js\\n  ```\\n\\n  * `components/` : \uacf5\ud1b5\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 component\ub4e4\uc744 \ubcf4\ud1b5 \ud558\ub098\uc758 \ud3f4\ub354\ub85c \ubb36\uc5b4\uc11c \uad00\ub9ac\ud574\uc900\ub2e4.\\n  * \ud30c\uc77c\uba85\uc740 Vue.js Style Guide\ub97c \ub530\ub77c \ud30c\uc2a4\uce7c\ucf00\uc774\uc2a4\ub85c \ub9cc\ub4e4\uc5b4\uc8fc\uc5c8\ub2e4.\\n  * Vue component \ud30c\uc77c\uc740 `.vue`\ub85c \uc800\uc7a5\ud55c\ub2e4.\\n\\n## \uac04\ub2e8\ud55c \ud504\ub85c\uc81d\ud2b8\ub85c \ubc30\uc6b0\uae30\\n\\n> Habit tracker\\n\\n### Template \ubcf5\uc0ac\ud558\uae30\\n\\n```bash\\ncd -R template habit-tracker\\n```\\n\\n* template\uc758 \uc0c1\uc704 \ub514\ub809\ud1a0\ub9ac\uc5d0\uc11c \uc785\ub825\\n\\n### Vue Mount\\n\\n* \uacf5\uc2dd \ubb38\uc11c\\n\\n  * [Lifecycle-Diagram](https://vuejs.org/v2/guide/instance.html#Lifecycle-Diagram)\\n  * [mounted](https://kr.vuejs.org/v2/api/index.html#mounted)\\n\\n* \uc6b0\ub9ac\uac00 \ub9cc\ub4e0 \ucef4\ud3ec\ub10c\ud2b8\ub97c `html`\uacfc \uc5f0\uacb0\ud574 \uc900\ub2e4.\\n\\n* `public/index.html`\\n\\n  ```html\\n  <body>\\n      ...\\n      ...\\n      <div id=\\"app\\"></div>\\n  </body>\\n  ```\\n\\n* `src/main.js`\\n\\n  ```js\\n  new Vue({\\n    render: h => h(App),\\n  }).$mount(\'#app\')\\n  ```\\n\\n* `app` component\ub294 Virtual DOM\uc5d0 \uc800\uc7a5\ub418\uace0 `vm.$mount(el)`\uc774 \ud638\ucd9c\ub418\uc5c8\uc744 \ub54c DOM\uc5d0 \uc5c5\ub370\uc774\ud2b8 \ub41c\ub2e4.\\n\\n### VUE \uc815\ub9ac\\n\\n> Vue Component\ub97c \uc800\uc7a5\ud574\uc8fc\uae30 \uc704\ud574 `app.vue` \ub85c \ub9cc\ub4e4\uc5b4 \uc8fc\uc5c8\ub2e4. \uadf8\ub7fc `.vue` \ub780 \ubb34\uc5c7\uc77c\uae4c?\\n\\n* \uacf5\uc2dd\ubb38\uc11c\\n\\n  * [Vue Single-File Component (SFC)](https://vue-loader.vuejs.org/spec.html)\\n\\n* `.vue` \uac00 \uc5c6\uc5c8\uc744 \ub54c Vue \uc791\uc131\ubc95\\n\\n  ```js\\n  // \ub4f1\ub85d\\n  Vue.component(\'my-component\', {\\n    template: \'<div>\uc0ac\uc6a9\uc790 \uc815\uc758 \ucef4\ud3ec\ub10c\ud2b8 \uc785\ub2c8\ub2e4!</div>\'\\n  })\\n  \\n  // \ub8e8\ud2b8 \uc778\uc2a4\ud134\uc2a4 \uc0dd\uc131\\n  new Vue({\\n    el: \'#example\'\\n  })\\n  ```\\n\\n* `html` \ucc98\ub7fc \uc785\ub825\ud560 \uc218 \uc788\ub3c4\ub85d \ud574\uc8fc\ub294 `.vue`\\n\\n  ```vue\\n  <template>\\n    <h1>Hello :)</h1>\\n  </template>\\n  ```\\n\\n#### \ube44\uc988\ub2c8\uc2a4 \ub85c\uc9c1 \uc791\uc131\\n\\n  ```vue\\n  <template>\\n    <div class=\\"example\\">{{ msg }}</div>\\n\\t{{ ok ? \'YES\' : \'NO\' }}\\n  </template>\\n  ```\\n\\n#### Language Blocks\\n\\n```vue\\n<template>\\n  <div class=\\"example\\">{{ msg }}</div>\\n</template>\\n\\n<script>\\nexport default {\\n  data () {\\n    return {\\n      msg: \'Hello world!\',\\n      ok: true\\n    }\\n  }\\n}\\n<\/script>\\n\\n<style>\\n.example {\\n  color: red;\\n}\\n</style>\\n\\n<custom1>\\n  This could be e.g. documentation for the component.\\n</custom1>\\n```\\n\\n##### Template\\n\\n* `vue-template-compiler`\uc5d0 \uc758\ud574 JavaScript code\ub85c Compile\ub418\uc5b4 html `<script>` section\uc5d0 \uc0bd\uc785\ub41c\ub2e4.\\n\\n##### Script\\n\\n* Vue.js [Component option object](https://vuejs.org/v2/api/#Options-Data) \ub85c \uc2e4\ud589\ub41c\ub2e4.\\n* ES Module\uc744 \uc2e4\ud589\ud558\uba70, Webpack \uaddc\uce59\uc744 \ub530\ub978\ub2e4.\\n\\n##### Style\\n\\n* CSS \ucf54\ub4dc\ub97c \uc785\ub825\ud560 \uc218 \uc788\ub2e4.\\n\\n##### Custom Blocks\\n\\n* \uc774\uc678\uc5d0\ub3c4 \ucd94\uac00\uc801\uc73c\ub85c Custom Block\uc744 \ub9cc\ub4e4\uc5b4 \uc904 \uc218 \uc788\ub2e4.\\n* [\uc0c1\uc138 \ub0b4\uc6a9](https://vue-loader.vuejs.org/guide/custom-blocks.html)\\n\\n### Habit tracker\\n\\n#### habit component \ub9cc\ub4e4\uae30\\n\\n* `vueInit` + tap \uc744 \ub204\ub974\uba74 \uc790\ub3d9\uc73c\ub85c \uae30\ubcf8\uc801\uc778 \ucf54\ub4dc\uac00 \uc368\uc9c4\ub2e4.\\n\\n  (Vue 3 Snippets extention\uc774 \uc124\uce58\ub41c \uacbd\uc6b0)\\n\\n* file name\uc740 \ub450\uac00\uc9c0 \uc774\uc0c1 \ub2e8\uc5b4\uc758 \ud569\uc131\uc5b4\ub85c PascalCase\ub85c \uc791\uc131\ud55c\ub2e4.\\n\\n#### Fontawesome \ucd94\uac00\\n\\n* \uc124\uce58\\n\\n  ```bash\\n  npm i --save @fortawesome/fontawesome-svg-core\\n  npm i --save @fortawesome/free-solid-svg-icons\\n  ## Using Vue 2.x\\n  npm i --save @fortawesome/vue-fontawesome@latest\\n  ```\\n\\n* [\uacf5\uc2dd\ubb38\uc11c](https://fontawesome.com/how-to-use/on-the-web/using-with/vuejs)\\n\\n* `src/main.js`\uc5d0 \ucd94\uac00\\n\\n  ```js\\n  import Vue from \\"vue\\";\\n  import App from \\"./App.vue\\";\\n  import { library } from \\"@fortawesome/fontawesome-svg-core\\";\\n  import { \\"\uc0ac\uc6a9\ud560 icon\\" } from \\"@fortawesome/free-solid-svg-icons\\";\\n  import { FontAwesomeIcon } from \\"@fortawesome/vue-fontawesome\\";\\n  \\n  library.add(\\"\uc0ac\uc6a9\ud560 icon\\");\\n  \\n  Vue.component(\\"font-awesome-icon\\", FontAwesomeIcon);\\n  \\n  Vue.config.productionTip = false;\\n  \\n  new Vue({\\n    render: (h) => h(App),\\n  }).$mount(\\"#app\\");\\n  ```\\n\\n* Fontawesome\uc5d0\uc11c \uac80\uc0c9\ud574\uc11c \ucd94\uac00\ud558\uae30\\n\\n  * \uc0c1\ub2e8 \uac80\uc0c9\ucc3d\uc5d0\uc11c \uc6d0\ud558\ub294 icon \uac80\uc0c9\\n\\n  * `src/main.js`\uc5d0 icon \ucd94\uac00\\n\\n    * import \ubaa9\ub85d\uc5d0 \ucd94\uac00\\n\\n      `import { \\"\uc0ac\uc6a9\ud560 icon\\" } from \\"@fortawesome/free-solid-svg-icons\\";`\\n\\n    * `library`\uc5d0 \ucd94\uac00\\n\\n      `library.add(\\"\uc0ac\uc6a9\ud560 icon\\");`\\n\\n#### Data \uc774\ud574\ud558\uae30\\n\\n* Component \uc548\uc5d0\ub294 Data\ub77c\ub294 \ud568\uc218\uac00 \uc788\uace0 \uadf8 \ud568\uc218\ub294 Object\ub97c return \ud55c\ub2e4.\\n\\n* Data\uc758 \uac01 \uc18d\uc131\ub4e4\uc774 \ubcc0\uacbd\ub418\uba74 Vue\uac00 `vm.mount()` \ud568\uc218\ub97c \ud638\ucd9c\ud558\uc5ec UI\uac00 \uc5c5\ub370\uc774\ud2b8 \ub41c\ub2e4.\\n\\n  * \uc774\ub54c Data\uc758 \uac01 \uc18d\uc131\ub4e4\uc5d0 \ub300\ud574 shallow(\uc595\uac8c) \ube44\uad50\ud558\ubbc0\ub85c \uac01 \uc18d\uc131\ub4e4\uc758 Reference\ub9cc \ube44\uad50\ud574\uc900\ub2e4.\\n\\n    \ub530\ub77c\uc11c, \uc18d\uc131\uc5d0 Object\uac00 \uc800\uc7a5\ub418\uc5b4\uc788\uace0 Object \ub0b4\ubd80\uc758 \uac12\uc774 \ubcc0\uacbd\ub420 \uacbd\uc6b0 Vue\uc5d0\uc11c \ubcc0\ud654\ub97c \uac10\uc9c0\ud558\uc9c0 \ubabb\ud55c\ub2e4.\\n  \\n* Data \uc758 \ubcc0\uacbd\uc744 \uac10\uc9c0\ud560 \ub54c\ub294 JS \uc758 getter/setter\uac00 \uc0ac\uc6a9\ub41c\ub2e4.\\n\\n* Data\uc758 \uac01 \uc18d\uc131\uac12\uc774 \ubcc0\uacbd\ub420 \ub54c\uc5d0\ub294 Vue\uc5d0\uc11c \uc774\ub97c \uac10\uc9c0\ud574 re-render \uc2dc\ucf1c\uc900\ub2e4.\\n\\n  \ud558\uc9c0\ub9cc \uac01 \uc18d\uc131\uac12\uc774 Object\ub85c \uc774\ub8e8\uc5b4\uc838 Reference\ub85c \ud655\uc778\ud560 \uc218 \uc5c6\uc744 \ub54c \ubcc0\ud654\ub97c \uac10\uc9c0\ud558\uae30 \uc704\ud574\uc11c\ub294 \uc5b4\ub5bb\uac8c \ud574\uc918\uc57c \ud560\uae4c?\\n\\n#### Vue.set\\n\\n* [\uacf5\uc2dd \ubb38\uc11c](https://vuejs.org/v2/api/#Vue-set)\\n* \uac01 \uc18d\uc131 Object\ub098 Array \ub0b4\ubd80\uc758 \uac12\uc774 \ubcc0\uacbd\ub420 \ub54c \uc774\ub97c \uac10\uc9c0\ud574\uc8fc\uae30 \uc704\ud574 `Vue.set()` API\ub97c \uc0ac\uc6a9\ud55c\ub2e4.\\n* `Vue.set( target, propertyName/index, value )` \\n  * `target` : Object or Array\\n  * `propertyName/index` : Object propertyName or Array index\\n  * `value` : any\\n\\n> \ubb3c\ub860 \uc0c8\ub85c\uc6b4 Object, Array\ub97c \uc0dd\uc131\ud558\uace0 \ub123\uc5b4\uc8fc\uc5b4 Reference\ub97c \ubc14\uafd4\uc8fc\ub294 \ubc29\uc2dd\uc73c\ub85c\ub3c4 \ud574\uacb0\ud560 \uc218 \uc788\ub2e4.\\n\\n#### Directives\\n\\n* `v-` \uc811\ub450\uc0ac\uac00 \uc788\ub294 \ud2b9\uc218\uc18d\uc131\uc73c\ub85c \ud45c\ud604\uc2dd\uc758 \uac12\uc774 \ubcc0\uacbd\ub420 \ub54c \ubc14\ub010 \uacb0\uacfc\ub97c DOM\uc5d0 \uc801\uc6a9\ud55c\ub2e4.\\n\\n  ```html\\n  \x3c!-- \uc608\uc2dc --\x3e\\n  <p v-if=\\"seen\\">Now you see me</p>\\n  \x3c!-- \\"seen\\"\uc758 boolean \uac12\uc5d0 \ub530\ub77c <p>\uac00 \uc0dd\uc131/\uc0ad\uc81c\ub41c\ub2e4. --\x3e \\n  ```\\n\\n* `v-bind`\\n\\n  * Data\uc758 \uc18d\uc131\uac12\uc744 \uac00\uc838\uc62c \uc218 \uc788\ub2e4.\\n\\n  ```html\\n  <img v-bind:src=\\"url\\" width=200px;>\\n  \x3c!-- \uc57d\uc5b4 --\x3e\\n  <img :src=\\"url\\" width=200px;>\\n  ```\\n\\n* `v-on`\\n\\n  * Vue\uc5d0\uc11c DOM \uc774\ubca4\ud2b8\ub97c \ub4e4\uc744 \uc218 \uc788\uac8c \ud574\uc900\ub2e4.\\n\\n  ```html\\n  \x3c!-- \uc608\uc2dc --\x3e\\n  <button v-on:click=\\"counter += 1\\">Add 1</button>\\n  \x3c!-- \uc57d\uc5b4 --\x3e\\n  <button @click=\\"counter += 1\\">Add 1</button>\\n  ```\\n\\n  \uc774\ubca4\ud2b8 \ud578\ub4e4\ub7ec\uc758 \ub85c\uc9c1\uc740 \ubcf5\uc7a1\ud558\ubbc0\ub85c \uc8fc\ub85c \uba54\uc18c\ub4dc\uc758 \uc774\ub984\uc744 \ud638\ucd9c\ud558\uace0 \ub9ce\uc740 \uc218\uc2dd\uc5b4\ub97c \uc81c\uacf5\ud55c\ub2e4.\\n\\n  \uc790\uc138\ud55c \ub0b4\uc6a9\uc740 \uc774\ud6c4 \uc774\ubca4\ud2b8 \uc218\uc2dd\uc5b4\uc5d0\uc11c \uc54c\uc544\ubcf4\uc790.\\n\\n* `v-model`\\n\\n  * Data\ub97c \uc591\ubc29\ud5a5\uc73c\ub85c \ubc14\uc778\ub529 \ud574\uc900\ub2e4.\\n\\n  * `v-model` \uc740 `v-bind`\uc640 `v-on`\uc73c\ub85c \uad6c\ud604\ud560 \uc218 \uc788\ub2e4.\\n\\n      \ub2e4\uc74c \ub450 \ucf54\ub4dc\uc758 \ub3d9\uc791\ubc29\uc2dd\uc740 \uc644\uc804\ud788 \ub611\uac19\ub2e4.\\n\\n      ```html\\n      <input v-model=\\"searchText\\">\\n      ```\\n\\n      ```html\\n      <input\\n        v-bind:value=\\"searchText\\"\\n        v-on:input=\\"searchText = $event.target.value\\"\\n      >\\n      ```\\n\\n* `v-for` \uc640 `v-if`\\n\\n  > `v-for`\ub294 `template`\uc5d0\uc11c for\ubb38\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \ud574\uc8fc\uace0`v-if` \ub294 if\ubb38\uc744 \uc0ac\uc6a9\ud558\uac8c \ud574\uc900\ub2e4.\\n  >\\n  > \uc774 \ub458\uc740 \uac19\uc774 \uc4f0\uc774\ub294 \uacbd\uc6b0\ub3c4 \ub9ce\uc73c\ubbc0\ub85c \uac19\uc774 \uc54c\uc544\ubcf4\uc790.\\n\\n  * `v-for` \uc640 `v-if`\ub97c \uac19\uc774 \uc368\uc904 \uacbd\uc6b0 `v-for`\uac00 \ub354 \ub192\uc740 \uc6b0\uc120\uc21c\uc704\ub97c \uac00\uc9c4\ub2e4.\\n\\n    \ub530\ub77c\uc11c `v-if`\ub294 \ub8e8\ud504\uac00 \ubc18\ubcf5\ub420 \ub54c\ub9c8\ub2e4 \uc2e4\ud589\ub41c\ub2e4.\\n\\n      ```html\\n    \x3c!-- \uc608\uc2dc (\uad8c\uc7a5\ud558\uc9c0 \uc54a\uc74c) --\x3e\\n    <ul>\\n      <li\\n        v-for=\\"user in users\\"\\n        v-if=\\"user.isActive\\"\\n        :key=\\"user.id\\"\\n      >\\n        {{ user.name }}\\n      </li>\\n    </ul>\\n      ```\\n\\n      \ud558\uc9c0\ub9cc `v-for`\uac00 \ub354 \ub192\uc740 \uc6b0\uc120\uc21c\uc704\ub97c \uac00\uc9c0\ub294 \ud2b9\uc131 \ub54c\ubb38\uc5d0 \uc774\ub807\uac8c \ucf54\ub4dc\ub97c \uc791\uc131\ud560 \uacbd\uc6b0 `v-else` \uc640 \uc774\uc911 for\ubb38\uc744 \uc791\uc131\ud560 \uc218 \uc5c6\ub294\ub4f1 \uc5ec\ub7ec \ubb38\uc81c\uac00 \ubc1c\uc0dd \ud560 \uc218 \uc788\uc5b4 \ub9e4\uc6b0 \uc88b\uc9c0 \ubabb\ud55c \uc2b5\uad00\uc774\ub2e4.\\n\\n  * `v-for`\uc640 `v-if`\ub97c \ud63c\uc6a9\ud560 \ub54c\ub294 \ub2e4\uc74c\uc758 Vue Style Guide \uad8c\uc7a5 \uc0ac\ud56d\uc744 \ub530\ub974\uc790\\n    \\n      ```html\\n      \x3c!-- \ubbf8\ub9ac \ud544\ud130\ub9c1\ud574\uc900 List\ub97c \uc0ac\uc6a9 --\x3e\\n      <ul>\\n        <li\\n          v-for=\\"user in activeUsers\\"\\n          :key=\\"user.id\\"\\n        >\\n          {{ user.name }}\\n        </li>\\n      </ul>\\n      ```\\n      \\n      ```html\\n      \x3c!-- v-if\ub97c \ubd80\ubaa8\uc694\uc18c\uc5d0 \uc801\uc6a9 --\x3e\\n      <ul v-if=\\"shouldShowUsers\\">\\n        <li\\n          v-for=\\"user in users\\"\\n          :key=\\"user.id\\"\\n        >\\n          {{ user.name }}\\n        </li>\\n      </ul>\\n      ```\\n\\n* `v-for` \uc640 `key`\\n\\n  * \uc11c\ube0c\ud2b8\ub9ac\uc758 \ub0b4\ubd80 \ucef4\ud3ec\ub10c\ud2b8 \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud558\uae30 \uc704\ud574 `v-for` \ub294 \ud56d\uc0c1 `key` \uc640 \ud568\uaed8 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n* `v-if` \uc640 `v-show`\\n\\n  * element\ub97c \uc870\uac74\ubd80\ub85c \ud45c\uc2dc\ud558\uae30 \uc704\ud55c \uc635\uc158\\n  * `v-if` \\n    * \uc870\uac74\uc5d0 \ub530\ub77c \ube14\ub85d\uc744 \ub80c\ub354\ub9c1\ud55c\ub2e4.\\n    * \ub370\uc774\ud130 \ud1a0\uae00 \ube44\uc6a9\uc774 \ub192\ub2e4.\\n  * `v-show` \\n    * \ud56d\uc0c1 \ub80c\ub354\ub9c1 \ub418\uace0 \uc870\uac74\uc5d0 \ub530\ub77c CSS `display` \uc18d\uc131\uc744 \ubcc0\uacbd\ud55c\ub2e4.\\n    * \ucd08\uae30 \ub80c\ub354\ub9c1 \ube44\uc6a9\uc774 \ub192\ub2e4.\\n  * \ub530\ub77c\uc11c \uc870\uac74\uc744 \uc790\uc8fc \ubcc0\uacbd\ud574\uc8fc\uc5b4\uc57c \ud558\ub294 \uacbd\uc6b0 `v-show`, \uc870\uac74\uc774 \ubcc0\uacbd\ub418\uc9c0 \uc54a\uc744 \uacbd\uc6b0 `v-if`\uac00 \uc120\ud638\ub41c\ub2e4.\\n\\n#### Props\uc640 Emit\\n\\n##### Props\ub780\\n\\n* Component \ubc16\uc5d0\uc11c \uc8fc\uc5b4\uc9c0\ub294 \ub370\uc774\ud130\\n\\n* \ubd80\ubaa8 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c\\n\\n  ```html\\n  <child message=\\"\uc548\ub155\ud558\uc138\uc694!\\"></child>\\n  ```\\n\\n  \uc640 \uac19\uc774 Props\ub97c \uc804\ub2ec\ud574\uc8fc\uba74 \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \\n\\n  ```html\\n  <template>\\n  \\t<span>{{ message }}</span>\\n  </template>\\n  ```\\n\\n  ```js\\n  props: [\'message\'] // \uad8c\uc7a5\ud558\uc9c0 \uc54a\uc74c \uc790\ub3d9\uc73c\ub85c \ud0c0\uc785 \uad6c\ubd84\\n  props: {           // \uad8c\uc7a5: \ud0c0\uc785 \uba85\uc2dc\\n      message: String\\n  }\\n  ```\\n\\n  \uc640 \uac19\uc774 `props`\ub97c \ubc1b\uc544\uc640\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n* Dynamic Props\\n\\n  * \ub3d9\uc801\uc73c\ub85c \ubcc0\ud558\ub294 Props\ub97c \ub118\uaca8\uc8fc\uae30 \uc704\ud574\uc11c\ub294 `v-bind`\ub97c \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4.\\n\\n    ```vue\\n    \x3c!-- Dynamically assign the value of a variable --\x3e\\n    <blog-post v-bind:title=\\"post.title\\"></blog-post>\\n    \\n    \x3c!-- Dynamically assign the value of a complex expression --\x3e\\n    <blog-post\\n      v-bind:title=\\"post.title + \' by \' + post.author.name\\"\\n    ></blog-post>\\n    ```\\n\\n    * \uc608\uc2dc\ub85c String\uc744 \uc0ac\uc6a9\ud558\uc600\uc9c0\ub9cc, Number, Boolean, Array, Object \ubaa8\ub450 \uc0ac\uc6a9 \uac00\ub2a5\ud558\ub2e4.\\n\\n* One-Way Data Flow\\n\\n  * \ubaa8\ub4e0 Props \ub4e4\uc740 \ubd80\ubaa8\uc5d0\uc11c \uc790\uc2dd, \ub2e8\ubc29\ud5a5\uc73c\ub85c \ub0b4\ub824\uac00\ub294 \ubc14\uc778\ub529 \ud615\ud0dc\ub97c \ucde8\ud55c\ub2e4.\\n\\n    -> \ubd80\ubaa8\uc758 \ud615\ud0dc\uac00 \ubcc0\ud558\uba74 \uc790\uc2dd \uc18d\uc131\uc5d0\uac8c \uc804\ub2ec\ub418\uc9c0\ub9cc, \ubc18\ub300\ub85c\ub294 \uc801\uc6a9\ub418\uc9c0 \uc54a\ub294\ub2e4.\\n\\n  * \ubd80\ubaa8 \ucef4\ud3ec\ub10c\ud2b8\uac00 \uc5c5\ub370\uc774\ud2b8 \ub420 \ub54c \ub9c8\ub2e4 \uc790\uc2dd \uc694\uc18c\uc758 \ubaa8\ub4e0 Props\ub4e4\uc774 \uc0c8\ub85c\uace0\uce68\ub41c\ub2e4.\\n\\n    -> \ub530\ub77c\uc11c \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8 \uc548\uc5d0\uc11c Props\ub97c \uc9c1\uc811 \uc218\uc815\ud574\uc11c\ub294 \uc548\ub41c\ub2e4.\\n\\n  * \uadf8\ub7fc\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0, \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \uaf2d Props\ub97c \ubcc0\uacbd\ud574\uc8fc\uc5b4\uc57c \ud560 \ub54c\ub294 \uc544\ub798\uc640 \uac19\uc774 \ucc98\ub9ac\ud558\uc790.\\n\\n    1. **prop\uc740 \ucd08\uae30\uac12\ub9cc \uc804\ub2ec\ud558\uace0, \uc790\uc2dd \ucef4\ud3ec\ub10c\ud2b8\ub294 \uadf8 \ucd08\uae30\uac12\uc744 \ub85c\uceec \ub370\uc774\ud130 \uc18d\uc131\uc73c\ub85c \ud65c\uc6a9\ud558\uace0 \uc2f6\uc740 \uacbd\uc6b0**\\n\\n       ```js\\n       props: [\'initialCounter\'],\\n       data: function () {\\n         return {\\n           counter: this.initialCounter\\n         }\\n       }\\n       ```\\n\\n    2. **\uc804\ub2ec\ub41c prop\uc758 \ud615\ud0dc\ub97c \ubc14\uafb8\uc5b4\uc57c \ud558\ub294 \uacbd\uc6b0**\\n\\n       `computed` \uc18d\uc131\uc744 \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \uc88b\ub2e4.\\n\\n       ```js\\n       props: [\'size\'],\\n       computed: {\\n         normalizedSize: function () {\\n           return this.size.trim().toLowerCase()\\n         }\\n       }\\n       ```\\n\\n* Validation\\n\\n  * Props\uc758 \uc720\ud6a8\uc131 \uac80\uc0ac\ub97c \ud1b5\ud574 Vue\ub294 JavaScript console\uc5d0 \uacbd\uace0\ub97c \ud45c\uc2dc\ud55c\ub2e4. \uc774\ub294 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uacfc \uac19\uc774 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uac1c\ubc1c\ud560 \uacbd\uc6b0 \ub9e4\uc6b0 \uc720\uc6a9\ud558\ub2e4.\\n\\n    ```js\\n    Vue.component(\'my-component\', {\\n      props: {\\n        // \uae30\ubcf8 \ud0c0\uc785 \uccb4\ud06c (`Null`\uc774\ub098 `undefinded`\ub294 \ubaa8\ub4e0 \ud0c0\uc785\uc744 \ud5c8\uc6a9\ud569\ub2c8\ub2e4.)\\n        propA: Number,\\n        // \uc5ec\ub7ec \ud0c0\uc785 \ud5c8\uc6a9\\n        propB: [String, Number],\\n        // \ud544\uc218 \ubb38\uc790\uc5f4\\n        propC: {\\n          type: String,\\n          required: true\\n        },\\n        // \uae30\ubcf8\uac12\uc774 \uc788\ub294 \uc22b\uc790\\n        propD: {\\n          type: Number,\\n          default: 100\\n        },\\n        // \uae30\ubcf8\uac12\uc774 \uc788\ub294 \uc624\ube0c\uc81d\ud2b8\\n        propE: {\\n          type: Object,\\n          // \uc624\ube0c\uc81d\ud2b8\ub098 \ubc30\uc5f4\uc740 \uaf2d \uae30\ubcf8\uac12\uc744 \ubc18\ud658\ud558\ub294\\n          // \ud329\ud1a0\ub9ac \ud568\uc218\uc758 \ud615\ud0dc\ub85c \uc0ac\uc6a9\ub418\uc5b4\uc57c \ud569\ub2c8\ub2e4. \\n          default: function () {\\n            return { message: \'hello\' }\\n          }\\n        },\\n        // \ucee4\uc2a4\ud140 \uc720\ud6a8\uc131 \uac80\uc0ac \ud568\uc218\\n        propF: {\\n          validator: function (value) {\\n            // \uac12\uc774 \ud56d\uc0c1 \uc544\ub798 \uc138 \uac1c\uc758 \ubb38\uc790\uc5f4 \uc911 \ud558\ub098\uc5ec\uc57c \ud569\ub2c8\ub2e4. \\n            return [\'success\', \'warning\', \'danger\'].indexOf(value) !== -1\\n          }\\n        }\\n      }\\n    })\\n    ```"},{"id":"how to start vue.js","metadata":{"permalink":"/blog/how to start vue.js","editUrl":"https://github.com/mooyeon-choi/mooyeon-choi.github.io/tree/master/blog/2022-10-28-0203.md","source":"@site/blog/2022-10-28-0203.md","title":"Vue.js \uc2dc\uc791\ud558\uae30","description":"\ubaa9\ucc28","date":"2022-10-28T00:00:00.000Z","formattedDate":"2022\ub144 10\uc6d4 28\uc77c","tags":[{"label":"Vuejs","permalink":"/blog/tags/vuejs"},{"label":"frontend","permalink":"/blog/tags/frontend"}],"readingTime":5.615,"hasTruncateMarker":true,"authors":[{"name":"Mooyeon Choi","url":"https://github.com/mooyeon-choi","imageURL":"https://github.com/mooyeon-choi.png","key":"mylog"}],"frontMatter":{"slug":"how to start vue.js","title":"Vue.js \uc2dc\uc791\ud558\uae30","authors":"mylog","tags":["Vuejs","frontend"]},"prevItem":{"title":"Vue.js Basic","permalink":"/blog/Vuejs basic"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"## \ubaa9\ucc28\\n\\n* [\ud544\uc694\ud55c \ud234 \uc124\uce58](#\ud544\uc694\ud55c-\ud234-\uc124\uce58)\\n* [Getting Started](#getting-started)\\n* [Project \uad6c\uc870](#project-\uad6c\uc870)\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud544\uc694\ud55c \ud234 \uc124\uce58\\n\\n### node.js\\n\\n* node.js \ub780?\\n\\n  * \uc5b4\ub290\uacf3\uc5d0\uc11c\ub098 JavaScript\ub85c \ud504\ub85c\uadf8\ub798\ubc0d\uc774 \uac00\ub2a5\ud558\uac8c \ud558\ub294 framework\\n  * server-side rendering, command line tools \ub4f1\uc5d0 \uc0ac\uc6a9\\n\\n* npm \uc774\ub780?\\n\\n  * Package Manager\\n  * library, package \ub4e4\uc744 \uc27d\uac8c \uad00\ub9ac\ud560 \uc218 \uc788\ub3c4\ub85d \ud574\uc90c\\n  * `package.json` \ud30c\uc77c\uc548\uc5d0 \uc0ac\uc6a9\ud558\ub294 \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub4e4\uacfc \ubc84\uc804 \uc815\ubcf4\ub4e4\uc774 \ub4e4\uc5b4\uc788\ub2e4.\\n\\n* npx \ub780?\\n\\n  * \uc6d0\ud558\ub294 library, package\ub97c \uc2e4\ud589\ud560 \uc218 \uc788\ub3c4\ub85d \ud574\uc90c\\n\\n  * \uc2e4\ud589\ud558\ub294 \ubc29\ubc95\\n\\n    ```bash\\n    npx \\"some-package\\"\\n    ```\\n\\n* [node.js \uacf5\uc2dd\uc0ac\uc774\ud2b8](https://nodejs.org/en/)\\n\\n* node, npm version \ud655\uc778\\n\\n  ```bash\\n  node -v\\n  v14.15.1\\n  \\n  npm -v\\n  6.14.8\\n  ```\\n\\n\\n\\n## Vue \uac1c\ubc1c\ud658\uacbd \ub9cc\ub4e4\uae30\\n\\n### `package.json` \ud30c\uc77c \uc0dd\uc131\\n\\n```bash\\nnpm init\\n```\\n\\n### Vue \uc124\uce58\\n\\n```bash\\nnpm install vue\\n```\\n\\n### Webpack \uc124\uce58 \\n\\n>  `webpack.config.js` \ud30c\uc77c \uc0dd\uc131\\n\\n```bash\\nnpm install webpack webpack-cli -D\\n```\\n\\n* webpack\uc740 \uac1c\ubc1c\ud658\uacbd\uc5d0\uc11c `\ubaa8\ub4c8 \ubc88\ub4e4\ub7ec`\ub85c\uc368 \ud65c\uc6a9\ud558\uae30 \uc704\ud55c \uac83\uc73c\ub85c `-D`\uc635\uc158\uc744 \ud1b5\ud574 `package.json`\uc5d0\uc11c `DevDependencies`\uc5d0 \ucd94\uac00\\n\\n### webpack.config.js \ud30c\uc77c \uc0dd\uc131\\n\\n```js\\n// webpack \uc124\uc815\\nconst VueLoaderPlugin = require(\'vue-loader/lib/plugin\')\\nconst path = require(\'path\')\\n\\nmodule.exports = {\\n    mode: \'development\', // vue\uc5d0\uc11c \uac1c\ubc1c\uc790 \ub3c4\uad6c \uc4f0\uac8c \ud574\uc90c \\n    // \uc5ec\ub7ec\uac1c\uc758 \ud30c\uc77c\uc744 \uc77d\uc5b4\uc624\uae30\\n    entry: {\\n        app: path.join(__dirname, \'src\', \'main.js\') // src\uc5d0 \uc788\ub294 main.js\\n    },\\n    // \uad00\ub828\ub41c \ubaa8\ub4c8\\n    module: {\\n        rules: [\\n            {\\n                test: /\\\\.vue$/, // .vue \ud655\uc7a5\uc790\ub294\\n                use: \'vue-loader\', // \ubaa8\ub450 vue-loader\ub85c \ubc88\uc5ed\uc744 \ud574\ub77c\\n            }\\n        ]\\n    },\\n    plugins: [\\n        new VueLoaderPlugin() // vue loader\uac00 \uac00\uc9c0\uace0 \uc788\ub294 plugin\uc744 \ubd88\ub7ec\uc624\uaca0\ub2e4.\\n    ],\\n    // \ucd5c\uc885 \uacb0\uacfc (.js)\\n    output: {\\n        filename: \'app.js\',\\n        path: path.join(__dirname, \'dist\') // \uacb0\uacfc\ub97c \uc774 \uacbd\ub85c\ub85c \ub358\uc838\uc918!\\n    }\\n}\\n```\\n\\n### main.js \uc0dd\uc131\\n\\n```js\\nimport vue from \'vue\' // vue \uc790\uccb4\ub97c \ubd88\ub7ec\uc634\\nimport App from \'./App.vue\' // \ub0b4\uac00 \ub9cc\ub4e0 vue \ud30c\uc77c\\n\\nnew Vue({\\n    el: \'#app\', \\n    // \ub80c\ub354\ub9c1\\n    render: function(createElement) {\\n        createElement(App)\\n    }\\n})\\n```\\n\\n### App.vue \uc0dd\uc131\\n\\n```html\\n\x3c!-- \uae30\ubcf8 \uad6c\uc870 --\x3e \\n<template>\\n    <h1> \uc774\uac8c \uc2f1\uae00\ud30c\uc77c\ucef4\ud3ec\ub10c\ud2b8, \ucd5c\uc0c1\uc704 \ucef4\ud3ec\ub10c\ud2b8\uc785\ub2c8\ub2e4. </h1>\\n</template>\\n<script>\\nexport default {\\n\\n}\\n<\/script>\\n<style lang=\\"\\">\\n\\n</style>\\n```\\n\\n### Vue \ud30c\uc77c\ub4e4\uc744 \ubc88\uc5ed, \ubd88\ub7ec\uc624\uae30 \uc704\ud55c \uc791\uc5c5\\n\\n```bash\\nnpm install vue-loader vue-template-compiler -D\\n```\\n\\n* `vue-loader` : Vue \ud30c\uc77c\uc744 \ubd88\ub7ec\uc624\ub294 \uc5ed\ud560\\n* `vue-template-compiler` : Vue \ud30c\uc77c\uc744 \ud574\uc11d\ud558\ub294 \uc5ed\ud560\\n\\n### index.html\uc5d0 \uc0ac\uc6a9\ud558\uae30\\n\\n```html\\n<script src=\\"../dist/main.js\\"><\/script>\\n```\\n\\n* \uc0dd\uc131\ub41c `main.js` \ud30c\uc77c\uc744 `index.html`\uc5d0 \uc704\uc640 \uac19\uc774 \uc0bd\uc785\ud558\uba74 Vue Component\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4. \\n\\n### \ubcc0\uacbd\uc0ac\ud56d \uc801\uc6a9\\n\\n```bash\\nnpm run build\\n```\\n\\n* \ubcc0\uacbd\uc0ac\ud56d\uc774 \uc0dd\uae34\ub2e4\uba74 \uc704 \uba85\ub839\uc5b4\ub85c \uc801\uc6a9\ud574\uc8fc\uc790\\n\\n### Style\\n\\n> CSS \ubd88\ub7ec\uc624\uae30\\n\\n```bash\\nnpm install vue-style-loader css-loader -D\\n```\\n\\n* `vue-style-loader` : vue\uc758 style\\n* `css-loader` : webpack css\ub97c \ubd88\ub7ec\uc624\ub294 \ub85c\ub354\\n\\n```js\\n// webpack.config.js // module -> rules \uc5d0 \ucd94\uac00\\n{\\n    test: \'/\\\\.css$/\',\\n    use: [\'vue-style-loader\', \'css-loader\'] // \uc55e\uc5d0\uaebc\uac00 css\ub97c \ub9cc\ub4e4\uac70\uace0 \ub4a4\uc5d0\uaebc\uac00 \ubd88\ub7ec\uc640\uc11c \ucc98\ub9ac\ud574\uc900\ub2e4\\n}\\n```\\n\\n\\n\\n## @vue/cli\\n\\n> \uc704\uc758 \ubcf5\uc7a1\ud55c \uacfc\uc815\ub4e4\uc744 \uc790\ub3d9\uc73c\ub85c \ucc98\ub9ac\ud574\uc8fc\ub294 package\\n\\n```bash\\nnpm install -g @vue/cli\\n```\\n\\n\\n\\n## Getting Started\\n\\n> `@vue/cli`\uc758 `vue create` \ub85c \uc0dd\uc131\ub418\ub294 \ud504\ub85c\uc81d\ud2b8\uc5d0\ub294 \uc5b4\ub5a4 \uac83\ub4e4\uc774 \uc788\ub294\uc9c0 \uc54c\uc544\ubcf8\ub2e4.\\n\\n* [\uacf5\uc2dd \ubb38\uc11c](https://cli.vuejs.org/guide/creating-a-project.html#vue-create)\\n\\n### Project \uc0dd\uc131\\n\\n```bash\\nvue create \'project name\'\\n```\\n\\n* `vue` 2.x version, `npm` module\uc744 \uc0ac\uc6a9\ud558\uc600\ub2e4.\\n* \ucc98\uc74c \uc0dd\uc131\uc2dc 1\ubd84\uc815\ub3c4 \uc18c\uc694\\n\\n### Project \uc2e4\ud589\\n\\n```bash\\nnpm run serve\\n```\\n\\n<img src=\\"C:/Users/moo/Desktop/TIL/web/frontend/vue/images/vue_start.PNG\\" width=\\"600px\\" />\\n\\n### Project \uc911\uc9c0\\n\\n`ctrl + c`\\n\\n## Project \uad6c\uc870\\n\\n```\\ntemplate/\\n\u251c\u2500\u2500 babel.config.js\\n\u251c\u2500\u2500 node_modules\\n\u251c\u2500\u2500 package-lock.json\\n\u251c\u2500\u2500 package.json\\n\u251c\u2500\u2500 public\\n|  \u251c\u2500\u2500 favicon.ico\\n|  \u2514\u2500\u2500 index.html\\n\u251c\u2500\u2500 README.md\\n\u2514\u2500\u2500 src\\n   \u251c\u2500\u2500 App.vue\\n   \u251c\u2500\u2500 assets\\n   \u251c\u2500\u2500 components\\n   \u2514\u2500\u2500 main.js\\n```\\n\\n### babel.config.js\\n\\n* [\uacf5\uc2dd \ubb38\uc11c](https://babeljs.io/docs/en/configuration)\\n* Babel\\n  * JavaScript transcompiler\\n  * ECMAscript 2015+ \ubc84\uc804\uc758 \ucf54\ub4dc\ub97c \uc774\uc804 \ubc84\uc804\uc73c\ub85c \ubcc0\ud658\ud574\uc900\ub2e4.\\n  * TypeScript, JSX \ub97c JavaScript\ub85c \ubcc0\ud658\ud574\uc900\ub2e4.\\n* Babel \ud658\uacbd \uc124\uc815\uc744 \uc704\ud55c \ud30c\uc77c\\n\\n### node_modules\\n\\n* \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ucd94\uac00\ud588\uc744\ub54c \uc790\ub3d9\uc801\uc73c\ub85c \ucd94\uac00\ub428\\n* \ub77c\uc774\ube0c\ub7ec\ub9ac \uad6c\uc870 \ud655\uc778 \uac00\ub2a5\\n\\n### package-lock.json\\n\\n* [\uacf5\uc2dd \ubb38\uc11c](https://docs.npmjs.com/cli/v6/configuring-npm/package-lock-json)\\n* npm\uc744 \uc0ac\uc6a9\ud574\uc11c `node_modules` \ud2b8\ub9ac\ub098 `package.json` \ud30c\uc77c\uc744 \uc218\uc815\ud558\uac8c\ub418\uba74 \uc790\ub3d9\uc73c\ub85c \uc0dd\uc131\ub418\ub294 \ud30c\uc77c\\n* \ud30c\uc77c\uc774 \uc0dd\uc131\ub418\ub294 \uc2dc\uc810\uc758 \uc758\uc874\uc131 \ud2b8\ub9ac\uc5d0 \ub300\ud55c \uc815\ud655\ud55c \uc815\ubcf4\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4.\\n\\n### package.json\\n\\n* npm\uc5d0\uc11c \ubc84\uc804\uc744 \uad00\ub9ac\ud560\ub54c \ub0b4 \ud504\ub85c\uadf8\ub7a8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc640 \uadf8 \ub77c\uc774\ube0c\ub7ec\ub9ac \ub4e4\uc758 \ubc84\uc804\uc774 \uba85\uc2dc\ub418\uc5b4 \uc788\ub2e4.\\n\\n  ```json\\n  {\\n    \\"name\\": \\"test\\",\\n    \\"version\\": \\"0.1.0\\",\\n    \\"private\\": true,\\n    \\"dependencies\\": {\\n      \\"@testing-library/jest-dom\\": \\"^5.11.4\\",\\n      ...\\n    },\\n    \\"devDependencies\\": {\\n      \\"@vue/cli-plugin-babel\\": \\"~4.5.0\\",\\n      ...\\n    },\\n    ...\\n  }\\n  ```\\n\\n  * `name` : \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \uc774\ub984\\n  * `version` : \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \ubc84\uc804\\n  * `private` : private or public\\n  * `dependencies` : \uc0ac\uc6a9\ud558\ub294 \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\\n  * `devDependencies` : \uac1c\ubc1c\uc5d0\ub9cc \uc0ac\uc6a9\ub418\ub294 \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\\n\\n### public/\\n\\n* \uc0ac\uc6a9\uc790\uc5d0\uac8c \ubc30\ud3ec\ud560 \ub54c \uc678\ubd80\uc801\uc73c\ub85c \ubcf4\uc5ec\uc9c0\ub294 \uac83\ub4e4\\n* `farvicon.ico`, `index.html` \ub4f1\\n\\n### README.md\\n\\n### src/\\n\\n* \uc18c\uc2a4\ucf54\ub4dc\\n* `main.js`, `App.vue` \ub4f1"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/mooyeon-choi/mooyeon-choi.github.io/tree/master/blog/2022-10-16-welcome/index.md","source":"@site/blog/2022-10-16-welcome/index.md","title":"Welcome","description":"","date":"2022-10-16T00:00:00.000Z","formattedDate":"2022\ub144 10\uc6d4 16\uc77c","tags":[{"label":"\uc2dc\uc791","permalink":"/blog/tags/\uc2dc\uc791"}],"readingTime":0,"hasTruncateMarker":false,"authors":[{"name":"Mooyeon Choi","url":"https://github.com/mooyeon-choi","imageURL":"https://github.com/mooyeon-choi.png","key":"mylog"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["mylog"],"tags":["\uc2dc\uc791"]},"prevItem":{"title":"Vue.js \uc2dc\uc791\ud558\uae30","permalink":"/blog/how to start vue.js"}},"content":""}]}')}}]);